import React, { useEffect, useState } from "react";

import axios from "axios";

class WhoAmI extends React.Component {


  constructor(props) {
    super(props);

    this.state = {
       Response:{ Items: []}, 
    };
}



render(){

    return (
        <div>
          { this.state.Response.Items && this.state.Response.Items.map(function (item, index){
            console.log(item);
            return (
              <div key={index}>
                <h2>{"http://127.0.0.1:8000"+item.Href} </h2>
              </div>
            );
          })}
        </div>
      );

}

};

export default WhoAmI;
